import Sucess from './components/Sucess/index'
import Active from "./components/Active/index"
import './App.css'
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";



function App() {
  return (

    <Router>
      <Switch>
        <div className="App">
          <Route exact path="/" component={Sucess} />
          <Route path="/Active" component={Active} />
        </div>
      </Switch>
    </Router>
  )
}
export default App;
